import React, { Component } from "react";
import { Route, Router, Link } from "react-router-dom";
// import Proof from "./Subcomponents/Proof";
// import Anagram from "./Subcomponents/Anagram";
import "./Projects.css";

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { anagram: false, proof: false, home: true };
  }
  handleClick = e => {
    if ([e.target.name] !== this.anagram) {
      this.setState({ anagram: false });
    }
    if ([e.target.name] !== this.proof) {
      this.setState({ proof: false });
    }
    if ([e.target.name] !== this.home) {
      this.setState({ home: false });
    }
    this.setState(prevState => ({
      check: !prevState.check
    }));
  };
  render() {
    return (
      <div className="projectMain">
        <div className="sidebar">
          <button className="projectButton">My Projects</button>
          <ul>
            <li>
              <button className="sideName" name="anagram" id="anagramButton">
                Anagram Generator
              </button>
            </li>
            <li>
              <button className="sideName" name="proof" id="proofButton">
                Proof Technology Webpage
              </button>
            </li>
          </ul>
        </div>
        <div className="mainItem">
          <div className="itemImage">test</div>
        </div>
      </div>
    );
  }
}
export default Projects;
